import React, {useState} from "react";

function form(props) {
	const [fname, setFname] = useState("");
  const onSubmit = (event) => {
    alert("value submitted");
	event.preventDefault();
  };

  return (
    <div>
      <form>
        <label>
          Name:
          <input type="text" name="name" onChange={(e)=>setFname(e.target.value)}/>
        </label>
        <button
          onClick={onSubmit}
        >
          Submit
        </button>
      </form>
    </div>
  );
}

export default form;
